import { DateRange } from "@material-ui/pickers/src/DateRangePicker/RangeTypes";

export class BankService {
  static getBalance = async (userId: number, page: number, pageSize: number = 10, selectedDate?: DateRange) => {
    const startAt = selectedDate && selectedDate[0] && selectedDate[0]!.getTime();
    const endAt = selectedDate && selectedDate[1] && selectedDate[1]?.getTime();

    console.log(JSON.stringify({
      Id: userId,
      CurrentPage: page,
      PageSize: pageSize,
      StartAt: startAt,
      EndAt: endAt
    }));


    const response = await fetch('http://localhost:5000/fivem/users/balance', {
      method: 'POST',
      headers: {'Content-Type': 'application/json'},
      body: JSON.stringify({
        Id: userId,
        CurrentPage: page,
        PageSize: pageSize,
        StartAt: startAt,
        EndAt: endAt
      })
    });
    const result = await response.json();

    return result;
  }
}
